var viVN={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Cho phép","Allow in your wallet":"Cho phép trong ví của bạn","Allow {symbol} first":["Cho phép ",["symbol"]," trước"],"Allowance pending":"Trợ cấp đang chờ xử lý","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Đã xảy ra lỗi khi cố gắng thực hiện hoán đổi này. Bạn có thể cần phải tăng khả năng chịu trượt của mình. Nếu điều đó không hiệu quả, có thể có sự không tương thích với mã thông báo bạn đang giao dịch. Lưu ý: phí chuyển và mã thông báo rebase không tương thích với Uniswap V3.","Approval pending":"Đang chờ phê duyệt","Approve":"Phê duyệt","Approve Permit2":"Approve Permit2","Approve in your wallet":"Phê duyệt trong ví của bạn","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Phê duyệt ",["symbol"]," trước"],"Auto":"Tự động","Auto Router":"Bộ định tuyến tự động","Auto Router API":"Auto Router API","Balance:":"Thăng bằng:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Đóng","Confirm in your wallet":"Xác nhận trong ví của bạn","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Kết nối ví","Connecting…":"Kết nối…","