ement of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Vui lòng nhập% trượt giá hợp lệ","Powered by the Uniswap protocol":"Được hỗ trợ bởi giao thức Uniswap","Price impact":"Tác động giá","Price updated":"Đã cập nhật giá","Reload":"Reload","Reload the page":"Tải lại trang","Request rejected":"Request rejected","Review swap":"Đánh giá hoán đổi","Search by token name or address":"Tìm kiếm theo tên hoặc địa chỉ mã thông báo","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Đã xảy ra sự cố","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Sự thành công","Swap":"Hoán đổi","Swap failed: {0}":["Hoán đổi không thành công: ",["0"]],"Switch network":"Chuyển mạng","Switch network in your wallet":"Chuyển đổi mạng trong ví của bạn","Switching network":"Chuyển mạng","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Bất biến Uniswap x * y = k không được thỏa mãn bởi hoán đổi. Điều này thường có nghĩa là một trong những mã token bạn đang hoán đổi kết hợp hành vi tùy chỉnh khi chuyển.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Không thể chuyển mã token đầu vào. Có thể có sự cố với mã token đầu vào.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Không thể chuyển mã token đầu ra. Có thể có sự cố với mã token đầu ra.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Không thể chuyển mã thông báo đầu ra. Có thể có sự cố với mã thông báo đầu ra. Lưu ý: phí chuyển và mã thông báo rebase không tương thích với Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Giao dịch này sẽ không thành công do biến động giá. Hãy thử tăng khả năng chịu trượt của bạn. Lưu ý: phí chuyển và mã thông báo rebase không tương thích với Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Giao dịch này sẽ không thành công do biến động giá hoặc phí chuyển nhượng. Hãy thử tăng khả năng chịu trượt của bạn.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Thời hạn giao dịch","Transaction rejected":"Giao dịch bị từ chối","Transaction submitted":"Giao dịch đã được gửi","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Hãy thử tăng khả năng chịu trượt của bạn.<0/>LƯU Ý: Phí chuyển và mã thông báo rebase không tương thích với Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Lỗi không mong đợi. Không thể ước tính khí cho hoán đổi.","Unexpected issue with estimating the gas. Please try again.":"Vấn đề không mong muốn với ước tính khí. Vui lòng thử lại.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Xem trên Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Cảnh báo","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Giao dịch của bạn sẽ hoàn nguyên nếu nó đã chờ xử lý lâu hơn khoảng thời gian này.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Giao dịch của bạn sẽ hoàn nguyên nếu giá thay đổi bất lợi hơn tỷ lệ phần trăm này.","minutes":"phút","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage to